import { useEffect, useState } from 'react';
import {
  Container, Typography, Paper, Table, TableBody, TableCell,
  TableContainer, TableHead, TableRow, Button, Chip, Box,
  CircularProgress, IconButton, Dialog, DialogTitle, DialogContent,
  DialogActions, TextField, FormControl, InputLabel, Select, MenuItem
} from '@mui/material';
import { 
  Refresh as RefreshIcon, 
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon
} from '@mui/icons-material';
import { useAppDispatch, useAppSelector } from '../hooks/redux';
import { fetchAgentsAsync, addAgentAsync, updateAgentAsync, deleteAgentAsync } from '../store/slices/agents.slice';
import { Agent } from '../types';

const Agents = () => {
  const dispatch = useAppDispatch();
  const { agents, status, error } = useAppSelector((state) => state.agents);
  const [openDialog, setOpenDialog] = useState(false);
  const [currentAgent, setCurrentAgent] = useState<Agent | null>(null);
  const [formData, setFormData] = useState({
    name: '',
    type: '',
    config: '',
    status: 'inactive'
  });

  useEffect(() => {
    dispatch(fetchAgentsAsync());
  }, [dispatch]);

  const handleRefresh = () => {
    dispatch(fetchAgentsAsync());
  };

  const handleOpenDialog = (agent?: Agent) => {
    if (agent) {
      setCurrentAgent(agent);
      setFormData({
        name: agent.name,
        type: agent.type,
        config: JSON.stringify(agent.config, null, 2),
        status: agent.status
      });
    } else {
      setCurrentAgent(null);
      setFormData({
        name: '',
        type: '',
        config: '{}',
        status: 'inactive'
      });
    }
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  const handleFormChange = (e: React.ChangeEvent<HTMLInputElement | { name?: string; value: unknown }>) => {
    const { name, value } = e.target;
    if (name) {
      setFormData({
        ...formData,
        [name]: value
      });
    }
  };

  const handleSubmit = async () => {
    try {
      let config;
      try {
        config = JSON.parse(formData.config);
      } catch (e) {
        alert('Invalid JSON in config field');
        return;
      }
      
      const agentData = {
        ...formData,
        config
      };
      
      if (currentAgent) {
        await dispatch(updateAgentAsync({ id: currentAgent.id, ...agentData }));
      } else {
        await dispatch(addAgentAsync(agentData));
      }
      
      handleCloseDialog();
    } catch (error) {
      console.error('Error saving agent:', error);
    }
  };

  const handleDeleteAgent = async (id: string) => {
    if (window.confirm('Are you sure you want to delete this agent?')) {
      try {
        await dispatch(deleteAgentAsync(id));
      } catch (error) {
        console.error('Error deleting agent:', error);
      }
    }
  };

  const getStatusColor = (status: string) => {
    switch (status.toLowerCase()) {
      case 'active':
        return 'success';
      case 'inactive':
        return 'error';
      case 'pending':
        return 'warning';
      default:
        return 'default';
    }
  };

  const loading = status === 'loading';

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4" component="h1">
          Agents
        </Typography>
        <Box>
          <Button 
            variant="contained" 
            startIcon={<AddIcon />} 
            onClick={() => handleOpenDialog()}
            sx={{ mr: 1 }}
          >
            Add Agent
          </Button>
          <Button 
            variant="outlined" 
            startIcon={<RefreshIcon />} 
            onClick={handleRefresh}
            disabled={loading}
          >
            {loading ? <CircularProgress size={24} /> : 'Refresh'}
          </Button>
        </Box>
      </Box>

      {error && (
        <Paper sx={{ p: 2, mb: 3, bgcolor: 'error.light', color: 'error.contrastText' }}>
          <Typography>{error}</Typography>
        </Paper>
      )}

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Type</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Last Active</TableCell>
              <TableCell align="right">Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {loading ? (
              <TableRow>
                <TableCell colSpan={5} align="center" sx={{ py: 3 }}>
                  <CircularProgress />
                </TableCell>
              </TableRow>
            ) : agents.length === 0 ? (
              <TableRow>
                <TableCell colSpan={5} align="center">
                  No agents found. Create your first agent.
                </TableCell>
              </TableRow>
            ) : (
              agents.map((agent) => (
                <TableRow key={agent.id}>
                  <TableCell>{agent.name}</TableCell>
                  <TableCell>{agent.type}</TableCell>
                  <TableCell>
                    <Chip 
                      label={agent.status} 
                      color={getStatusColor(agent.status) as any}
                      size="small"
                    />
                  </TableCell>
                  <TableCell>{agent.lastActive ? new Date(agent.lastActive).toLocaleString() : 'Never'}</TableCell>
                  <TableCell align="right">
                    <IconButton 
                      size="small" 
                      onClick={() => handleOpenDialog(agent)}
                      aria-label="edit"
                    >
                      <EditIcon />
                    </IconButton>
                    <IconButton 
                      size="small" 
                      onClick={() => handleDeleteAgent(agent.id)}
                      aria-label="delete"
                      color="error"
                    >
                      <DeleteIcon />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="md" fullWidth>
        <DialogTitle>
          {currentAgent ? 'Edit Agent' : 'Add New Agent'}
        </DialogTitle>
        <DialogContent>
          <TextField
            margin="dense"
            name="name"
            label="Name"
            type="text"
            fullWidth
            variant="outlined"
            value={formData.name}
            onChange={handleFormChange}
            sx={{ mb: 2 }}
          />
          <TextField
            margin="dense"
            name="type"
            label="Type"
            type="text"
            fullWidth
            variant="outlined"
            value={formData.type}
            onChange={handleFormChange}
            sx={{ mb: 2 }}
          />
          <FormControl fullWidth margin="dense" sx={{ mb: 2 }}>
            <InputLabel id="agent-status-label">Status</InputLabel>
            <Select
              labelId="agent-status-label"
              name="status"
              value={formData.status}
              onChange={handleFormChange}
              label="Status"
            >
              <MenuItem value="active">Active</MenuItem>
              <MenuItem value="inactive">Inactive</MenuItem>
              <MenuItem value="pending">Pending</MenuItem>
            </Select>
          </FormControl>
          <TextField
            margin="dense"
            name="config"
            label="Configuration (JSON)"
            multiline
            rows={8}
            fullWidth
            variant="outlined"
            value={formData.config}
            onChange={handleFormChange}
            sx={{ mb: 2 }}
            helperText="Enter the agent configuration in JSON format"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default Agents;
